const UserProfile = () => {
    return (
        <Flex w='100%' justifyContent='center'>
            <VStack w='75%'>
                <Box w='100%'>
                    <UserDetails />
                </Box>
            </VStack>
        </Flex>
    )
}

const UserDetails = () => {
